import './App.css';
import {BrowserRouter,Route,Routes} from 'react-router-dom';
import Movies from './pages/Movies';
import Home from './pages/Home';


function App() {
  return (
    <BrowserRouter>
    <Routes> 
       <Route path ='/home' element={<Home/>}></Route>
       </Routes>
      </BrowserRouter>
  );
}

export default App;
